import React from "react";

const ResponsiveUI = () => {
  return (
    <div
      className="relative w-full h-screen bg-black"
      style={{ overflow: "hidden" }}
    >
      <video
        src="https://framerusercontent.com/assets/oi6sebXDmnVMQbvHHKXGiG0hNw.mp4"
        loop
        autoPlay
        muted
        playsInline
        style={{
          width: "100%",
          height: "100%",
          objectFit: "cover",
          position: "absolute",
          top: "0",
          left: "0",
        }}
      />
    </div>
  );
};

export default ResponsiveUI;
